import React, { Fragment, useEffect } from "react";
import { Modal } from "react-bootstrap";
const OutputModal = ({ show, handleClose, error }) => {
	const Body = () => {
		if (error === null) {
			return (
				<Modal.Body>
					<p>
						Your feedback has been successfully receiced. Thank you
						for getting in touch!
					</p>
				</Modal.Body>
			);
		} else {
			return (
				<Modal.Body>
					<p>
					Oops!! {error.messages}
						</p>
				</Modal.Body>
			);
		}
	};

	return (
		<Fragment>
			<Modal
				show={show}
				onHide={handleClose}
				onShow={e => {
					if (error === null) {
						e.target.classList.remove("br-danger-subtle");
						e.target.classList.add("br-success");
					} else {
						e.target.classList.remove("br-success");
						e.target.classList.add("br-danger-subtle");
					}
				}}
			>
				<Modal.Header closeButton>
					<Modal.Title>Modal heading</Modal.Title>
				</Modal.Header>

				<Modal.Footer>
					<Button variant="primary" onClick={handleClose}>
						Ok
					</Button>
				</Modal.Footer>
			</Modal>
		</Fragment>
	);
};

export default OutputModal;
